import React, { Component } from 'react';

class Courses extends Component {
   constructor(props) {
      super(props)

      this.state = {
         iOpen: true
      }
   }

   render() {
      const { card } = this.props
      return (
         <div>
            <a href="href" className="course" role="link">
               <div className="course_img" style={{
                  backgroundImage: `url(${process.env.PUBLIC_URL + '/course_1.jpg'})`,
                  backgroundSize: cover,
                  width: '25%',
                  height: '160px',
               }}></div>
               <div className="course_title">{card.title}</div>
               <div className="start-date">Початок: {card.date}</div>
            </a>
         </div >
      )
   }
}

export default Courses;
